let input5 = '';
let test5 = 'dabAcCaCBAcCcaDA';

function react(input) {
  let changed = true;
  while (changed) {
    changed = false;
    for (let i = 0; i < input.length; i++) {
      if (i < input.length - 1 && input[i].toLowerCase() === input[i+1].toLowerCase()) {
        if (input[i] !== input[i+1]) {
          input = input.substr(0, i) + input.substr(i+2);
          changed = true;
          break;
        }
      }
    }
  }

  return input;
}

function fifth1() {
  const reacted = react(input5);
  return reacted.lenght;
};

